import React from 'react'
import { ChannelContext, UseCont1, UserContext } from './UseCont1'

export const UseCont5 = () => {
  return (
    <div>
      <UserContext.Consumer>
        {
          (user) => {
            return
            <ChannelContext.Consumer>
              {
                (channel) => {
                  return <h1></h1>
                }
              }
            </ChannelContext.Consumer>
          }
        }
      </UserContext.Consumer>
    </div>
  )
}
